      | 47169 -> { ItemTypeData.id= 47169; name= "Sleipnir Bloody Hands SKIN (Permanent)"; published= true; description= "The Bloody Hands of Matar is a Minmatar terrorist organization responsible for numerous attacks in both the Republic and the Amarr Empire.    The group was founded in early YC109, during a period of protest and rioting at the killing of Defiants leader Karishal Muritor by Republic forces acting under the orders of Karin Midular's government. It is believed that the 'Bloody Hands' symbolism was inspired by the use of a bloody fist logo by the Ushra'Khan alliance of capsuleer freedom fighters.    The Bloody Hands of Matar turned from protest to terrorism with a campaign of firebombing Amarr and Ammatar interests on Minmatar worlds. The group's violence escalated with a bomb attack on the Egbonbet Republic Parliament station that succeeded in assassinating a visiting Ammatar Mandate ambassador in mid YC109.    The terror group pulled off their greatest coup in March YC112, killing thousands in the massive bombing of an Amarr Ministry of War station in Pashanai system. Although hunted by both Republic Security Services and the Amarr Ministry of Internal Order, the Bloody Hands have evaded elimination and officially remain an active threat."; marketGroupId= Some(2107); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
